anharem ao longo do exercício, esse equipamento pode ser uma boa edição para você. A braçadeira posso ajuste uma alça ajustável, protege seu aparelho, possuem porta fones nas laterais e fácil acesso para tela inicial do aparelho.\r\n\r\n\r\n<strong>SmartBands:\r\n\r\n\r\n</strong>Pode não parecer, mas elas são diferentes dos SmartWatches citados acima. Diferente dos relógios, elas foram desenvolvidas diretamente para o mundo Fitness não possuindo um visor para atender chamadas ou responder mensagens. Suas funções ficam direcionadas para o monitoramento, possuem uma bateria mais duradoura e custo benefício mais acessível.\r\n\r\n\r\n<strong>Fone de ouvido via Bluetooth: </strong>\r\n\r\n<strong> </strong>\r\n\r\nA música não pode ficar fora da sua atividade e você já deve saber qual o ritmo certo para te acompanhar. Geralmente os fones comuns não possuem um Design voltado à prática de exercícios físicos podendo atrapalhar em certos momentos. A melhor solução é optar por fones com tecnologia Bluetooth desenvolvidos para auxiliar atletas. JBL, Samsung, Pulse, Phillips são marcas que possuem essa linha de produtos com funções interessantes como isolamento de ruído, resistência ao suor, materiais resistentes e de alta qualidade.\r\n\r\n\r\nVocê já utilizou algum desses equipamentos ou gostaria de recomendar algum? Conte para nós qual seu favorito e como ele te ajuda na sua rotina de exercícios. Fale conosco através das nossas redes sociais!\r\n\r\n<strong> </strong>\r\n\r\n<strong> </strong>','Os melhores gadgets para te auxiliar na sua rotina de exercícios.','','publish','closed','closed','','os-melhores-gadgets-para-te-auxiliar-na-sua-rotina-de-exercicios','','','2018-06-27 09:59:24','2018-06-27 12:59:24','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=233',0,'aprenda','',0),(234,1,'2018-06-27 10:03:51','2018-06-27 13:03:51','Entre os grandes eventos esportivos do mundo, temos as paraolimpíadas que são um sucesso em todas as edições com atletas competindo no seu mais alto nível e cheios de orgulho em representar seu país ao longo da competição.\r\n\r\nAntes de se firmar como uma competição, a história dos jogos começa em 1943, na pequena cidade Inglesa Stoke Mandeville, quando o neurologista Ludwig Guttman recebeu a importante missão de reabilitar soldados que vieram da Segunda Guerra Mundial. Como uma solução para ajudar esses soldados, Guttman montou um tratamento que uniu trabalho com esportes como basquetebol, tiro com arco, dardo e bilhar.\r\n\r\nEm 1948, ele promoveu o primeiro evento esportivo voltado para portadores deficiência após o sucesso do tratamento. Os jogos voltados para esses atletas continuaram todos os anos seguintes se tornando um evento internacional no ano de 1952.\r\n\r\nEm 1960, na cidade de Roma, ocorreram os primeiros jogos no estilo olímpico para atletas com deficiência.\r\nAtualmente, a competição representa uma disputa com atletas do mais alto nível competindo em 23 modalidades.\r\n\r\n&nbsp;\r\n\r\nCom todo esse potencial esportivo, nós da Atletas Now, não podíamos ficar de fora! Para isso, estamos cada vez querendo adicionar mais e mais esportes, desse modo os esportes paraolímpicos já estão sendo desenvolvidos para ser englobados em nossa rede!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','História dos jogos Paraolímpicos','','publish','closed','closed','','historia-dos-jogos-paraolimpicos','','','2018-06-27 10:03:51','2018-06-27 13:03:51','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=234',0,'aprenda','',0),(239,1,'2018-06-27 10:09:24','2018-06-27 13:09:24','<p style=\"text-align: left;\"><strong>Guilherme Paraense:\r\n</strong>\r\nVocê conhece a história do atleta Guilherme Paraense?</p>\r\n<p style=\"text-align: left;\">Talvez esse nome seja desconhecido para você, mas Guilherme foi o primeiro brasileiro a conquistar uma medalha de ouro para nosso país.</p>\r\n<p style=\"text-align: left;\">O atleta nasceu em Belém do Pará, no dia 25 de junho de 1884. Com apenas 5 anos de idade, foi para o Rio de Janeiro e começou a frequentar a Escola Militar de Realengo.</p>\r\n<p style=\"text-align: left;\">O tiro estava entre os exercícios exigidos nas suas atividades como militar e sempre teve facilidade nesse exercício acertando alvos de diferentes formatos e tamanhos.</p>\r\n<p style=\"text-align: left;\">\r\nSeu talento lhe rendeu o campeonato Brasileiro e Sulamericano na modalidade tiro com revolver.\r\nEm 1920, a delegação viajou até Bruxelas para competirem nos jogos daquele ano. A prova consistia em 30 tiros a uma distância de 30 metrôs do alvo e Guilherme acertou os três últimos que foram determinantes para a decisão. Paraense fez 274 pontos de 300, faturando, pela primeira vez, o lugar mais alto do pódio para nosso país.</p>\r\n<p style=\"text-align: left;\">Se hoje nosso país possui uma safra de campeões, Guilherme Paraense teve uma grande contribuição para o início da nossa história como campeões.</p>\r\n&nbsp;\r\n\r\nAssim como Guilherme no passado, muitos atletas atualmente sofrem com a mesma falta de atenção de divulgação e mídia. Atletas Now chegou para mudar essa realidade e ajudar a explorar o inexplorado!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA\r\n\r\n&nbsp;\r\n<p style=\"text-align: left;\"></p>','Pouca Mídia, Muito Talento!','','publish','closed','closed','','pouca-midia-muito-talento','','','2018-07-04 16:27:32','2018-07-04 19:27:32','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=239',0,'aprenda','',0),(243,1,'2018-06-28 16:35:54','2018-06-28 19:35:54','Organizada pelo COI (Comitê Olímpico Internacional), os primeiros jogos de inverno aconteceram em 1924, na cidade de Chamonix, na França com a participação de 258 atletas de 16 países diferentes, entre eles 247 homens e 11 mulheres.\r\n\r\nPor algum tempo, os jogos de verão e inverno eram realizados no mesmo país, mas com os ventos da Segunda Guerra Mundial, duas edições foram canceladas e somente após o término desses eventos, os jogos eram realizados em sedes diferentes, porém no mesmo ano.\r\n\r\nEm 1986, as Olímpiadas de verão e inverno passaram a acontecer de forma intercalada, com uma pausa de dois anos entre as duas competições.\r\n\r\nA primeira participação do Brasil ocorreu nos jogos de 1992, na França. Nosso comitê contou com 7 atletas, todos atuando pela modalidade do Esqui Alpino. Desde então, o Brasil vem aumentando sua participação e na última edição conto com 9 atletas. Aparentemente, nosso país tropical começou a desbravar cada vez mais lugares gelados.\r\n\r\n&nbsp;','História dos jogos de inverno','','publish','closed','closed','','historia-dos-jogos-de-inverno','','','2018-06-28 16:35:54','2018-06-28 19:35:54','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=243',0,'aprenda','',0),(244,1,'2018-06-28 16:38:28','2018-06-28 19:38:28','O que antes era considerado apenas diversão ou entretenimento, hoje conta com campeonatos de elite espalhados por todo o globo, jogadores de alto nível e grandes quantias de premiações.\r\nOs campeonatos de jogos eletrônicos ganharam destaque abrindo espaço na grade de grandes emissoras.\r\n\r\nA TV Globo possui o programa Zero1, comandado por Tiago Leifert, o apresentador recebe convidados especiais para analisar os principais eventos do mundo dos games e repercutir os campeonatos de “esports”. O canal Esporte Interativo, dedica um tempo para o mesmo assunto com o EI Games não somente em seu canal por assinatura, mas também em mídias como Twitter e principalmente Youtube, assim como o site dos canais ESPN que possuem transmissões e uma sessão exclusiva sobre o tema em seu site.\r\n\r\nTalvez você possa argumentar dizendo que não existe grande esforço físico para competir na modalidade e ser considerado esporte, mas com equipes cada vez mais qualificadas que representam nosso país em nível global, esteja na hora de rever seus conceitos e apoiar esses atletas.\r\n\r\nPensando nesses competidores, a AtletasNow já possui seu espaço para Gamers adicionarem seu perfil.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','Videogame é esporte sim!','','publish','closed','closed','','videogame-e-esporte-sim','','','2018-06-28 16:38:28','2018-06-28 19:38:28','',0,'https://atletasnow.com/?post_type=aprenda&#038;p=244',0,'aprenda','',0),(261,1,'2018-07-06 09:39:30','2018-07-06 12:39:30','Bernardinho, vitorioso treinador de vôleibol, é conhecido por seu jeito explosivo e energético dentro das quadras.\r\n\r\nAcreditamos que alguém com tanta bagagem, tenha muito conhecimento para compartilhar com públicos de diversas idades, por isso, separamos um vídeo no qual o professor fala sobre como construir times de alto rendimento\r\n\r\n&nbsp;\r\n\r\nhttps://www.youtube.com/watch?v=K8AlIqBhX0A&amp;t=121s\r\n\r\n&nbsp;\r\n\r\n<strong>Fonte:</strong> <strong>Orador:</strong> Bernardinho.\r\n<strong>Canal:</strong> Endeavor Brasil','Palavras de quem sabe - Bernardinho','','publish','closed','closed','','https-www-youtube-com-watchvk8aliqbhx0a','','','2018-07-06 10:36:27','2018-07-06 13:36:27','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=261',0,'aprenda','',0),(263,1,'2018-07-06 10:36:25','2018-07-06 13:36:25','<iframe width=\"920\" height=\"518\" src=\"https://www.youtube.com/embed/K8AlIqBhX0A?start=121&feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>','','','publish','closed','closed','','e890903c0e89c0dd57de53519303a6ff','','','2018-07-06 10:36:25','2018-07-06 13:36:25','',0,'https://atletasnow.com/app/sem-categoria/e890903c0e89c0dd57de53519303a6ff/',0,'oembed_cache','',0),(273,1,'2018-07-10 16:38:37','2018-07-10 19:38:37','O que passa na cabeça dos atletas?\r\n\r\nO TED TALK é uma série de conferências, sem fins lucrativos, que possui o intuito de espalhar e debater ideias. Os temas são os mais variados possíveis, sempre contanto com a presença de algum profissional que seja referência no assunto debatido.\r\nNo vídeo que separamos, o psicólogo Martin Hagger explica ao longo da conversa, técnicas que atletas e técnicos utilizam para se preparem psicologicamente antes de competirem para atingirem grandes performances.\r\n\r\nhttps://www.youtube.com/watch?v=yG7v4y_xwzQ\r\n\r\n&nbsp;\r\n\r\n<strong>Fonte: </strong>Canal – TED X TALKS\r\nOrador – Martin Hagger <strong>\r\n</strong>Tradução: Brescia Terra\r\nRevisão: Pedro Reis\r\n\r\n<strong>\r\n\r\n\r\n</strong>\r\n\r\n&nbsp;','Na Cabeça dos Campeões','','publish','closed','closed','','na-cabeca-dos-campeoes','','','2018-07-10 16:39:17','2018-07-10 19:39:17','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=273',0,'aprenda','',0),(274,1,'2018-07-10 16:38:44','2018-07-10 19:38:44','<iframe width=\"846\" height=\"476\" src=\"https://www.youtube.com/embed/yG7v4y_xwzQ?feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>','','','publish','closed','closed','','efb865fbe049e5a6f70f99c93b09d577','','','2018-07-10 16:38:44','2018-07-10 19:38:44','',0,'https://atletasnow.com/app/sem-categoria/efb865fbe049e5a6f70f99c93b09d577/',0,'oembed_cache','',0),(279,1,'2018-07-12 14:16:31','2018-07-12 17:16:31','Antes do Jogos Olímpicos começarem, a Tocha Olímpica precisa ser acesa para oficializar o início da competição. A Chama percorre um grande trajeto passando por cidades e pelas mãos de convidados que vão conduzi-la até seu destino.\r\nOs Jogos Olímpicos começaram na cidade de Olímpia, na Grécia antiga, por isso, receberam este nome. Os Gregos consideravam o fogo como algo divino, então acendiam chamas nas portas dos templos e, na naquela época, mensageiros percorriam cidades para anunciar que a data de início da competição estava se aproximando. Além disso, os Jogos marcavam um período de paz entre os povos.\r\nEsses acontecimentos marcaram o que podemos chamar de “Jogos Olímpicos da Antiguidade” explicando suas origens e tradições. Na era moderna, na cidade de Amsterdã, em 1928, foi a primeira edição a ter uma Pira Olímpica acesa em um dos seus estádios. Na edição de Berlim, em 1936, foi realizado o primeiro revezamento da Tocha Olímpica que percorreu sete países antes de chegar na cidade que recebeu os Jogos naquele ano.\r\nAo longo do tempo, a Tocha recebeu algumas modificações no seu design para não apagar ao longo do caminho, independente da condição climática. Mas, ela nunca perdeu seu real significado, ou seja, simbolizar o espírito de paz ao longo da competição.\r\n\r\nNós da AtletasNow, acreditamos que o esporte, de fato, é capaz de conectar diferentes culturas e queremos que o espírito esportivo esteja cada vez mais presente em todos os lugares para qualquer modalidade esportiva.','A Tocha Olímpica e seu verdadeiro significado.','','publish','closed','closed','','a-tocha-olimpica-e-seu-verdadeiro-significado','','','2018-07-12 14:16:31','2018-07-12 17:16:31','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=279',0,'aprenda','',0),(280,1,'2018-07-12 17:02:12','2018-07-12 20:02:12','Gustavo Kuerten, mais conhecido como Guga, sem dúvidas é uma inspiração para todos os esportistas. Além de uma trajetória vitoriosa, seu carisma e palavras podem contagiar uma arena inteira.\r\nSeparamos uma palestra do grande jogador na qual ele conta os bastidores das suas competições e muitas histórias pessoais capaz de despertar o espirito campeão de qualquer pessoa.\r\n\r\nhttps://www.youtube.com/watch?v=e-t8Gtq7Jr8\r\n\r\nFonte: Canal: Canal Oficial Guga Kuerten\r\nOrador: Guga\r\nOnde: Palestra Endeavor.','Bastidores do sucesso.','','publish','closed','closed','','bastidores-do-sucesso','','','2018-07-12 17:02:37','2018-07-12 20:02:37','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=280',0,'aprenda','',0),(281,1,'2018-07-12 17:02:20','2018-07-12 20:02:20','<iframe width=\"846\" height=\"476\" src=\"https://www.youtube.com/embed/e-t8Gtq7Jr8?feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>','','','publish','closed','closed','','15cc3d43a8f2e3cca6db112fcdb1449c','','','2018-07-12 17:02:20','2018-07-12 20:02:20','',0,'https://atletasnow.com/app/sem-categoria/15cc3d43a8f2e3cca6db112fcdb1449c/',0,'oembed_cache','',0),(283,1,'2018-07-13 14:50:41','0000-00-00 00:00:00','','Catálogo Esportivo','','draft','closed','closed','','','','','2018-07-13 14:50:41','2018-07-13 17:50:41','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=283',0,'aprenda','',0),(284,1,'2018-07-13 15:05:21','2018-07-13 18:05:21','Sabemos que o catálogo da Netflix possui uma grande variedade de conteúdos capaz de deixar qualquer um confuso do que assistir com tantas opções. Para te ajudar, a equipe da AtletasNOW separou os melhores conteúdos esportivos para todo fã do esporte “maratonar” e se divertir. Agora, prepare a pipoca e acompanhe a lista:\r\n<ul>\r\n 	<li><strong> Eu sou Bolt:</strong> O documentário acompanha a puxada rotina de treinos do campeão e recordista olímpico, Usain Bolt. O material também conta com imagens, entrevistas e curiosidades sobre os bastidores da carreira do velocista.</li>\r\n 	<li><strong>Becoming Zlatan: </strong>Goleador, polêmico e campeão por onde passou, esse documentário acompanha os primeiros chutes até o sucesso mundial do craque Sueco, Zlatan Ibrahimovic. Se você admira o futebol do gigante jogador, essa opção não pode faltar na sua lista.</li>\r\n 	<li><strong>#Rucker50 – Gigantes do Basquete: </strong>Para os fãs do basquete, esse documentário celebra os 50 anos do programa esportivo do Harlem que transformou diversos jovens de Nova York em jogadores profissionais.</li>\r\n 	<li><b><strong>Senna: O Brasileiro. O herói. O campeão: </strong></b>Mais que um piloto de Fórmula 1, podemos dizer que Ayrton Senna é um ídolo nacional que marcou gerações não somente dentro como fora das pistas. Com esse premiado documentário, podemos matar um pouco a saudade do grande corredor.</li>\r\n 	<li><strong>Motivation 3: The Next Generation:  </strong>Voltado para os esportes radicais, o documentário acompanha a vida de quatro Skatistas que competem pelo prêmio de suas vidas no Tampa Am 2016.</li>\r\n 	<li><strong>Last Chance U:</strong> A série documental acompanha a vida de jovens jogadores do futebol americano que buscam conquistar seu espaço nesse esporte tão concorrido.</li>\r\n</ul>\r\nGostou da nossa lista? Comente o que achou das nossas recomendações. Se quiser sugerir outro material, comente em nossas redes sociais.\r\n\r\n&nbsp;','Catálogo Esportivo','','publish','closed','closed','','catalogo-esportivo','','','2018-07-13 15:20:30','2018-07-13 18:20:30','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=284',0,'aprenda','',0),(287,1,'2018-07-13 16:41:27','2018-07-13 19:41:27','O final de semana está chegando, mas o esporte nunca tira folga! Para você não perder nada, separamos o que de mais legal vai rolar entre sábado e domingo. Se liga:\r\n\r\n&nbsp;\r\n\r\n<strong>Final da Copa: </strong>Infelizmente, a Copa do Mundo chegou na sua reta final. Sábado teremos a decisão do terceiro lugar entre Bélgica e Inglaterra e, no domingo, a grande decisão entre França e Croácia.\r\n\r\nBélgica X Inglaterra:\r\n\r\nRede Globo – 11h – 14/ JUL\r\n\r\nSPORTV – 11h – 14/JUL\r\n\r\nFoxSports – 11h – 14/JUL\r\n\r\n&nbsp;\r\n\r\nFrança x Croácia:\r\n\r\n&nbsp;\r\n\r\nRede Globo – 11h – 15/ JUL\r\n\r\nSPORTV – 11h – 15/ JUL\r\n\r\nFoxSports – 11h – 15/ JUL\r\n\r\n&nbsp;\r\n\r\nOficialmente, o último jogo vai começar às 12h (Horário de Brasília), mas as emissoras vão começar a transmissão antes da bola rolar. Desejamos muita diversão e bom futebol para todos que vão acompanhar aos dois últimos da Copa do Mundo, independente da torcida.\r\n\r\n<strong>Velocidade máxima: </strong>Para os amantes da velocidade, no sábado, também não vai faltar opção porque teremos o Mundial de Motovelocidade:\r\n\r\n&nbsp;\r\n\r\nMundial de Motovelocidade: Treino Oficial MOTO 3 – Alemanha\r\n\r\nSPORTV 2 – 07h15 – 14/ JUL\r\n\r\n&nbsp;\r\n\r\nMundial de Motovelocidade: Treino Oficial MOTO GP – Alemanha\r\n\r\nSPORTV 2 – 08h30 – 14/ JUL\r\n\r\n&nbsp;\r\n\r\nMundial de Motovelocidade: Treino Oficial MOTO 2 – Alemanha\r\n\r\nSPORTV 2 – 10h05 – 14/ JUL\r\n\r\n&nbsp;\r\n\r\n<strong>Tênis:</strong> o tradicional torneio de Wimbledon terá uma emocionante final na categoria simples masculina.\r\n\r\n&nbsp;\r\n\r\nWimbledon – Finais\r\nFinal: Simples Masculina\r\n\r\nSPORTV 3 – 10h – 15/JUL\r\n\r\n<strong>NBA SUMMER LEAGUE: </strong>O campeonato que serve para os times da maior liga de basquete do mundo testarem seus jovens jogadores e preencheram as vagas que estão faltando no time já começou. Não deixe de conferir:\r\n\r\nESPN Extra – 19h30 – 14/07 JUL\r\n\r\nESPN Extra – 21h30 – 14/07 JUL\r\n&nbsp;','O esporte NUNCA descansa!','','publish','closed','closed','','o-esporte-nunca-descansa','','','2018-07-13 16:41:27','2018-07-13 19:41:27','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=287',0,'aprenda','',0),(290,112,'2018-07-15 16:56:21','2018-07-15 19:56:21','','IMG-20180613-WA0040','','inherit','open','closed','','img-20180613-wa0040','','','2018-07-15 16:56:21','2018-07-15 19:56:21','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/IMG-20180613-WA0040.jpg',0,'attachment','image/jpeg',0),(291,111,'2018-07-15 18:27:10','2018-07-15 21:27:10','','unnamed-14','','inherit','open','closed','','unnamed-14','','','2018-07-15 18:27:10','2018-07-15 21:27:10','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/unnamed-14.jpg',0,'attachment','image/jpeg',0),(300,1,'2018-07-16 15:15:07','2018-07-16 18:15:07','Daniel Dias:\r\n\r\n&nbsp;\r\n\r\nEntre as raias de uma piscina, é onde nosso maior atleta Paralímpico, Daniel Dias, costuma esbanjar seu talento.\r\nDaniel de Faria Dias nasceu no dia 24 de maio de 1988 com uma má formação Congênita nos braços e na perna direita. Desde pequeno, o nadador sempre possuiu interesse por esportes e gostava de praticar alguma atividade física na época da escola. Porém, foi em 2004, nos Jogos Paralímpicos de Atenas, que surgiu o sonho de representar seu país quando viu outro atleta, Clodoaldo Silva, brilhar nas águas e levar seis medalhas de ouro. Nessa edição, Daniel pôde conhecer e se interessar pela modalidade dando início na sua trajetória como atleta.\r\nNo ano de 2006, ele participou da sua primeira competição oficial e de cara faturou duas medalhas de bronze, mas foi no final do ano, na África do Sul, onde o atleta conquistou o lugar mais alto do pódio.\r\nEm 2008, nos Jogos de Pequim, Daniel fez sua estreia nos Jogos competindo nas categorias S5, SB4 e SM5 fechando a competição com quatro medalhas de ouro, quatro pratas e um bronze. Na edição seguinte, em Londres, ele obteve sucesso em todas modalidades que participou faturando incríveis seis medalhas de ouro.\r\nNos jogos do Rio de Janeiro, em 2016, Daniel chegou na competição somando quinze medalhas no currículo, o que já podemos considerar algo impressionante. Mas, o campeão nunca parou de nos surpreender e terminou a competição com quatro medalhas de ouro, três de prata e duas de bronze, somando vinte e quatro medalhas na carreira.\r\nAtualmente, Daniel continua escrevendo sua história competindo em diversas competições, além de realizar palestras sobre superação e propagar o esporte Paralímpico no país.\r\nNão basta colecionar diversas medalhas, o atleta também é um exemplo de pessoa que, sem dúvida, vai continuar brilhando por onde competir.\r\n\r\n&nbsp;\r\n\r\nNós queremos compartilhar histórias dos mais diversos atletas para mostrar o quanto eles são importantes para o esporte nacional e internacional. Você gostou do atleta dessa semana? gostaria de sugerir algum campeão para aparecer neste quadro?\r\nQueremos saber sua sugestão, então corre para nossas redes sociais e fale de alguém que pode aparecer aqui semana que vem.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','Pouca Mídia, Muito Talento!','','publish','closed','closed','','pouca-midia-muito-talento-2','','','2018-07-16 16:26:16','2018-07-16 19:26:16','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=300',0,'aprenda','',0),(303,1,'2018-07-16 15:55:49','2018-07-16 18:55:49','Bom, talvez a expressão correta ainda pode gerar dúvidas entre muitas pessoas, mas o termo correto (ou definido) é <strong>Paralímpico.\r\n</strong>Não entendeu muito bem? Deixa que a gente explica melhor:\r\nNo final de 2011, o Comitê Olímpico Internacional (COI) modificou o nome para Paralímpico como forma de todos os países se alinharem e utilizarem a mesma linguagem, surgindo o Comitê Paralímpico Internacional. O prazo para todas as instituições se adaptarem e modificarem para Paralímpico foi de um ano.\r\nEm 2016, nos Jogos do Rio, o Brasil adotou o novo termo para se alinhar com todos os outros países, seguindo a orientação do Comitê. Naquele ano, quando o logo oficial foi apresentado, já podíamos ler “Jogos Paralímpicos”\r\nPortanto, na próxima vez que você ler “<strong>Paralímpico</strong>”, quem digitou ou escreveu a palavra não esqueceu do “O” na palavra, apenas adotou a nova medida.<strong>\r\n\r\n</strong>','Afinal: devemos falar Paraolímpico ou Paralímpico?','','publish','closed','closed','','afinal-devemos-falar-paraolimpico-ou-paralimpico','','','2018-07-16 15:55:49','2018-07-16 18:55:49','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=303',0,'aprenda','',0),(305,1,'2018-07-17 11:42:06','2018-07-17 14:42:06','Hortência de Fátima Marcari ou apenas Hortência é considerada uma das maiores jogadoras de basquete de todos os tempos. A jogadora é a maior pontuadora da história da seleção, somando incríveis 3.160 pontos, marcados em 127 partidas. Em 2002, todo seu talento a levou ao Hall da Fama do Basquetebol Feminino, nos Estados Unidos e, em 2005,  do Naismith Memorial Basketball Hall of Fame.\r\nSeparamos uma entrevista na qual a jogadora fala sobre sua trajetória, passa todo seu conhecimento e ressalta a importância de amar sua profissão para sempre se manter motivado(a) todos os dias.\r\n\r\n&nbsp;\r\n\r\nhttps://www.youtube.com/watch?v=LF_ZwS-Npt4\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #000000; font-family: Calibri;\"><strong>Fonte: </strong>\r\nCanal - Foras de Série.\r\nEntrevistada - Hortência| Ex-Jogadora de Basquete.</span>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;','Uma gigante entre nós','','publish','closed','closed','','uma-gigante-entre-nos','','','2018-07-17 11:42:24','2018-07-17 14:42:24','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=305',0,'aprenda','',0),(307,1,'2018-07-17 11:42:15','2018-07-17 14:42:15','<iframe width=\"846\" height=\"476\" src=\"https://www.youtube.com/embed/LF_ZwS-Npt4?feature=oembed\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>','','','publish','closed','closed','','9426bb34764d5500c9c096e5b7dc2479','','','2018-07-17 11:42:15','2018-07-17 14:42:15','',0,'https://atletasnow.com/app/sem-categoria/9426bb34764d5500c9c096e5b7dc2479/',0,'oembed_cache','',0),(308,1,'2018-07-17 12:28:20','2018-07-17 15:28:20','Os cartões amarelos e vermelhos são utilizados para advertir os jogadores de futebol seja por alguma jogada mais violenta, agressão ou discussão contra seu adversário. Porém, o futebol não nasceu com os cartões como forma de sinalizar uma falta, então com o passar do tempo foi necessário criar uma linguagem (ou sinal) universal para os jogadores entenderem essa punição.\r\nTudo começou em 1966 com o polêmico jogo entre Inglaterra e Argentina. Na ocasião, o capitão argentino Rattín questionou uma falta marcada pelo árbitro alemão Rudolf Kreitlein, mas como o juiz não entendia espanhol, utilizou seu dedo para sinalizar a expulsão do jogador de campo diante de uma reclamação mais exaltada.\r\nContudo, existia uma falha de comunicação em campo com um árbitro alemão, jogadores argentinos e os ingleses que, naquele ano, eram a seleção anfitriã.\r\nO chefe dos árbitros recebeu a missão de solucionar o problema para a próxima edição do mundial. A inspiração surgiu quando a caminho do estádio, dentro de um táxi, percebeu que no sinal amarelo o motorista reduzia a velocidade, e no vermelho parava imediatamente. Em 1970, na Copa do México, os cartões foram introduzidos ao jogo com amarelo para advertência e vermelho para expulsão, logo a “simples” invenção se tornou uma linguagem universal entre árbitros e jogadores.\r\nAgora, imagine como seria o futebol sem os cartões nos dias de hoje?\r\n\r\nA equipe da AtletasNow acredita que as histórias que construíram o mundo dos esportes são muito importantes para entendermos como as regras e jogos são aplicados atualmente, por isso, toda semana vamos trazer novas histórias para vocês. Se quiser sugerir alguma outra história, comente em nossas redes sociais.\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','Foi lance para cartão?','','publish','closed','closed','','foi-lance-para-cartao','','','2018-07-17 12:30:15','2018-07-17 15:30:15','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=308',0,'aprenda','',0),(312,24,'2018-07-18 15:50:25','0000-00-00 00:00:00','qdwqdqw','','','draft','closed','closed','','','','','2018-07-18 15:50:25','0000-00-00 00:00:00','',0,'https://atletasnow.com/app/?p=312',0,'timeline','',0),(313,24,'2018-07-18 15:50:34','0000-00-00 00:00:00','testasdadsa','','','draft','closed','closed','','','','','2018-07-18 15:50:34','0000-00-00 00:00:00','',0,'https://atletasnow.com/app/?p=313',0,'timeline','',0),(314,24,'2018-07-18 15:51:10','2018-07-18 18:51:10','','1.3_E-Book_Gestão','','inherit','open','closed','','1-3_e-book_gesta%cc%83o','','','2018-07-18 15:51:10','2018-07-18 18:51:10','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/1.3_E-Book_Gestão.png',0,'attachment','image/png',0),(315,34,'2018-07-18 15:53:44','2018-07-18 18:53:44','','jason-leung-479251-unsplash-1','','inherit','open','closed','','jason-leung-479251-unsplash-1','','','2018-07-18 15:53:44','2018-07-18 18:53:44','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/jason-leung-479251-unsplash-1.jpg',0,'attachment','image/jpeg',0),(317,1,'2018-07-18 16:24:20','2018-07-18 19:24:20','{{unknown}}','','','publish','closed','closed','','34f3df033438d2aff12a8ac16d406d49','','','2018-07-18 16:24:20','2018-07-18 19:24:20','',0,'https://atletasnow.com/app/sem-categoria/34f3df033438d2aff12a8ac16d406d49/',0,'oembed_cache','',0),(322,1,'2018-07-18 16:53:41','2018-07-18 19:53:41','Maria Lenk  - 1ª Brasileira a participar dos Jogos Olímpicos:\r\n\r\n&nbsp;\r\n\r\nForam das raias das piscinas que emergiu a primeira mulher a disputar os Jogos Olímpicos pelo Brasil. Maria Emma Hulga Lenk Zigler ou Maria Lenk, foi pioneira para a natação feminina.\r\nEla começou cedo no esporte, conquistou títulos nacionais nadando pelo Flamengo e,\r\ncom apenas 17 anos, a nadadora embarcou com a federação composta por homens e uma única mulher para os Jogos Olímpicos na cidade de Los Angeles, em 1932.\r\nEm sua estreia, ela competiu em três provas: os 100m livres, 100m costas e 200m peito. A debutante não conquistou medalhas, mas sua participação foi um marco em uma época na qual a presença feminina não era comum.\r\nEla participou de outras edições dos jogos e outros campeonatos de natação, quebrou recordes mundiais nos 400m e 200m e fora das piscinas, em 1942, ajudou na fundação da Escola Nacional de Educação Física da Universidade do Brasil, UFRJ, no Rio de Janeiro. Escreveu o livro “Longevidade e Esporte” falando dos benefícios da natação para seus praticantes e chegou ao Hall da Fama da federação internacional de Natação.\r\nInfelizmente, faleceu no ano de 2007 enquanto nadava na piscina do Flamengo devido uma parada cardiorrespiratória.\r\nCom toda essa bagagem e por tudo que Maria Lenk fez pelo esporte, não somente podemos dizer que ela fez história, mas se tornou uma lenda do país!\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;','Pouca Mídia, Muito Talento!','','publish','closed','closed','','pouca-midia-muito-talento-3','','','2018-07-23 15:33:37','2018-07-23 18:33:37','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=322',0,'aprenda','',0),(324,121,'2018-07-18 23:56:27','2018-07-19 02:56:27','','ENG-UVA-TIJUCA','','inherit','open','closed','','eng-uva-tijuca','','','2018-07-18 23:56:27','2018-07-19 02:56:27','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/ENG-UVA-TIJUCA.png',0,'attachment','image/png',0),(325,96,'2018-07-19 09:51:16','2018-07-19 12:51:16','','IMG-20180713-WA0027','','inherit','open','closed','','img-20180713-wa0027','','','2018-07-19 09:51:16','2018-07-19 12:51:16','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/IMG-20180713-WA0027.jpeg',0,'attachment','image/jpeg',0),(326,1,'2018-07-19 10:59:32','0000-00-00 00:00:00','&nbsp;\n\nA popularidade do Futebol Americano cresceu muito nos últimos anos. Atualmente, não precisamos procurar muito para encontramos algum torcedor fanático ou estabelecimentos que vão transmitir jogos importantes. No país predominado pelo futebol, a bola oval já ganhou seu espaço, mas ainda pode gerar algumas dúvidas para os novos adeptos, por isso, separamos um vídeo que explica as regras básicas do jogo para você entender melhor como ele funciona.\n\n\n\n&nbsp;\n\nFonte:\nCanal Oficial – NFL\nNarração e Explicação – Everaldo Marques\n&nbsp;','Entendendo o Futebol Americano','','draft','closed','closed','','','','','2018-07-19 10:59:32','2018-07-19 13:59:32','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=326',0,'aprenda','',0),(327,1,'2018-07-19 17:07:33','2018-07-19 20:07:33','O mundo dos esportes além de nos proporcionar momentos incríveis e emocionantes, também pode nos ensinar muito. Por isso, separamos uma lista que todo admirador do esporte não pode deixar de ter em sua coleção:\r\n\r\n&nbsp;\r\n\r\nGuga, um brasileiro\r\n\r\nGuga é uma referência para o esporte brasileiro e um dos maiores atletas da história do tênis.\r\nSempre muito carismático, seu talento e dedicação foram compensados com uma trajetória de sucesso e muitas conquistas. Este livro mostra os bastidores de sua carreira desde o início, glórias e momentos que precisou lidar com lesões mostrando toda sua superação.\r\n\r\n&nbsp;\r\n\r\nOscar Schmidt: 14 Motivos Para Viver, Vencer e Ser Feliz\r\n\r\nOscar nunca jogou a NBA, mas atingiu um feito que poucos atletas conseguem: chegou ao Hall da Fama do Basquete. No livro, o ex-jogador compartilha suas histórias de como se tornou um atleta campeão e usa sua dedicação para vencer todos os obstáculos.\r\n\r\n&nbsp;\r\n\r\nAlex Ferguson: Liderança\r\n\r\nAlex Ferguson treinou o Manchester United por muitos anos conquistando todos os títulos possíveis, além de treinar e revelar craques ao longo desses anos. A obra traz os segredos do treinador, o que é necessário para construir equipes de alto rendimento, como lidar com o fracasso e como alcançar o sucesso.\r\n\r\n&nbsp;\r\n\r\nMarketing Esportivo - Uma Visão Estratégica e Atual\r\n\r\nVoltado para os negócios por trás dos esportes, o livro apresenta conceitos de Marketing aplicados no mundo esportivo e estratégias inovadoras para este mercado englobando as mais diversas modalidades.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nGostou das nossas dicas? Gostaria de recomendar outro livro? Comente em nossas redes sociais algum livro para que todos os amantes do esporte possam ler, se divertir e aprender.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','Livros que você não pode deixar de ler!','','publish','closed','closed','','livros-que-voce-nao-pode-deixar-de-ler','','','2018-07-20 10:29:39','2018-07-20 13:29:39','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=327',0,'aprenda','',0),(328,75,'2018-07-19 18:45:34','2018-07-19 21:45:34','','AtletasNow-Logo','','inherit','open','closed','','atletasnow-logo','','','2018-07-19 18:45:34','2018-07-19 21:45:34','',0,'https://atletasnow.com/app/wp-content/uploads/2018/07/AtletasNow-Logo.jpg',0,'attachment','image/jpeg',0),(329,75,'2018-07-19 18:46:24','0000-00-00 00:00:00','uhuuuuuuuuuul','','','draft','closed','closed','','','','','2018-07-19 18:46:24','0000-00-00 00:00:00','',0,'https://atletasnow.com/app/?p=329',0,'timeline','',1),(335,1,'2018-07-20 12:49:07','2018-07-20 15:49:07','Outro final de semana chegando, mas isso não significa que o mundo dos esportes vai repousar. Separamos o que de mais legal podemos ver no próximo final de semana, então se programe e não deixe de conferir os eventos abaixo:\r\n\r\n<strong> </strong>\r\n\r\n<strong>Futebol:\r\n</strong>Depois da ressaca pós-Copa do mundo, os times ao redor do mundo e nosso campeonato nacional estão de volta. Para você matar a saudade de forma organizada, separamos os principais jogos e torneios que vão acontecer:\r\n\r\n<strong> </strong>\r\n\r\n<strong>Futebol Europeu:</strong>\r\n\r\nOs times do velho continente estão espalhados pelo mundo para iniciar sua preparação para a próxima temporada.\r\n\r\n&nbsp;\r\n\r\nFOX Sports: Bayern de Munique X Paris Saint-Germain – 21/07 – 11h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv2: Inter de Milão (ITA) X Zenit (RUS) – 21/07 – 15h10 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nFox Sports: Liverpool (ING) X Borrusia Dortmund (ALE) – 22/07 – 17h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<strong>Futebol Nacional:</strong>\r\n\r\nO campeonato nacional está de volta e chegou a hora de você matar a saudade do seu time.<strong>\r\n</strong>\r\n<strong>Sábado:</strong>\r\n\r\nSportv: Coritiba X São Bento – Série B – 21/07 – 16h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv: Boa Esporte X Ponte Preta – Série B – 21/07 – 18h30 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: Flamengo X Botafogo – Série A – 21/07 – 19h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: São Paulo X Corinthians – Série A – 21/07 – 21h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Domingo:</strong>\r\n\r\nSportv: Chapecoense X Santos – Série A – 22/07 – 17h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: Palmeiras X Atlético MG – Séria A – 22/07 – 16h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: Bahia X Vitória – Série A – 22/07 – 16h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nPremiere: Sport X Fluminense – Série A – 22/07 – 16h (Ao Vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>\r\nAutomobilismo:</strong>\r\n\r\nNas pistas e autódromos espalhados por todo mundo, os corredores estão disputando cada curva para chegar ao lugar mais alto do pódio.\r\n\r\n&nbsp;\r\n\r\n<strong>Sábado</strong>\r\n\r\nSportv2: 3º treino livre de Fórmula 1 – GP da Alemanha – 21/07 – 06h45 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv2: treino oficial de Fórmula 1 – GP da Alemanha – 21/07 – 09h30 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv2: Campeonato Brasileiro de Kart – 21/07 – 11H25 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Domingo</strong>\r\n\r\nSportv2: Porshe Supercup – GP da Alemanha – 22/07 - 07h00 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nRede Globo: Fórmula 1 – GP da Alemanha – 22/07 - 10h10 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Luta:</strong>\r\n\r\nOs ringes e octógonos também vão estar presentes nos principais eventos deste final de semana.\r\n\r\n&nbsp;\r\n\r\n<strong>Sábado:</strong>\r\nSportv: Boxe Internacional: Yamagushi Falcão X Elias Espadas/ Munguia X Smith – 21/07 – 21h55 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Domingo</strong>:\r\nSportv2: UFC: Shogun X Smith – Card Preliminar – 22/07 – 11h30 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Esports</strong>\r\nEnquanto alguns vão usar videogame para relaxar, outros vão competir profissionalmente.\r\n\r\n&nbsp;\r\n\r\n<strong>Sábado</strong>:\r\nEsporte Interativo: EI Games – 21/07 – 12h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\nSportv2: CBLOL – 21/07 – 13h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Hipismo:\r\n</strong>Na Alemanha, o campeonato de Hipismo também não para e você não pode deixar de conferir a próxima etapa da competição.\r\n\r\n&nbsp;\r\n\r\nSportv3: Chio Aachen de Hipismo – Grand Prix – 22/07 – 08h20 (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>X-Games</strong>\r\nPara os amantes dos esportes radicais, opções também não vão faltar.\r\n\r\n&nbsp;\r\n\r\n<strong>Sábado</strong>:\r\nESPN: X-GAMES MINNEAPOLIS 2018: FINAL BMX DIRT, MOTO X BEST WHIP, MOTO X BEST TRICK E SKATE BIG AIR – 21/07 – 20h (Ao Vivo)\r\n\r\n&nbsp;\r\n\r\n<strong>Domingo:</strong>\r\nESPN: X-GAMES MINNEAPOLIS 2018: FINAL HARLEY DAVIDSON, SKATE PARK FEMININO, SKATE STREET E BMX PARK MASCULINO – 22/07 – 14h (Ao vivo)\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nDesejamos muita diversão e esportes para todos.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA','O esporte NUNCA descansa!','','publish','closed','closed','','o-esporte-nunca-descansa-2','','','2018-07-20 12:54:16','2018-07-20 15:54:16','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=335',0,'aprenda','',0),(338,1,'2018-07-20 15:56:52','2018-07-20 18:56:52','&nbsp;\r\n\r\nAndar de bicicleta, além de ser uma atividade prazerosa, traz diversos benefícios para nossa saúde. Seja na ciclovia, ciclo faixa, na academia ou mesmo no parque mais próximo da sua residência, espaços para praticar o esporte não vão faltar. Separamos alguns benefícios que pedalar podem para sua saúde:\r\n\r\n&nbsp;\r\n<ul>\r\n 	<li>Previne doenças cardiovasculares;</li>\r\n 	<li>Auxilia no controle da pressão arterial;</li>\r\n 	<li>Ajuda na prevenção de hérnias de disco;</li>\r\n 	<li>Melhora sua cognição;</li>\r\n 	<li>Auxilia no emagrecimento;</li>\r\n 	<li>Melhora a frequência cardíaca;</li>\r\n 	<li>Fortalece os músculos;</li>\r\n 	<li>Diminui o estresse.</li>\r\n</ul>\r\n&nbsp;\r\n\r\nDepois de ler todas essas dicas, o que você está esperando para tirar sua Bike de casa?\r\n\r\n&nbsp;\r\n\r\n#ATLETASNOWSUAHORAÉAGORA\r\n\r\n&nbsp;','Vamos pedalar?','','publish','closed','closed','','vamos-pedalar','','','2018-07-20 15:58:34','2018-07-20 18:58:34','',0,'https://atletasnow.com/app/?post_type=aprenda&#038;p=338',0,'aprenda','',0),(340,126,'2018-07-21 13:30:29','0000-00-00 00:00:00','Sou mais um sonhador, apesar da idade \"avançada\" pro futebol me espelho em jogadores que começaram tarde como durval e grafite.','','','draft','closed','closed','','','','','2018-07-21 13